import React from 'react';
import { Typography } from '@mui/material';
import GoogleLoginButton from './googleLogin';
import './studentLogin.css';

const Login = ({ role }) => {
  const responseMessage = (response) => {
    console.log(`${role} Login Success:`, response);
    // Handle the login response
  };

  const errorMessage = (error) => {
    console.log(`${role} Login Failed:`, error);
    // Handle login error
  };

  return (
    <div className={`${role.toLowerCase()}-login-container`}>
      <Typography variant="h4" component="h2" gutterBottom className={`${role.toLowerCase()}-login-title`}>
        {role} Login
      </Typography>
      <GoogleLoginButton onSuccess={responseMessage} onError={errorMessage} />
    </div>
  );
}

export default StudentLogin;
